import React from "react";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./Expense.css";
import ExpensesList from "./ExpensesList";

const Expense = (props) => {
  return (
    <div className="expenses">
      <ExpensesList items={props} />
    </div>
  );
};

export default Expense;
